import Listing from '../../Listing'

type JobListingsItemProps = {
  id: string,
  title: string,
  body?: string
}

const JobListingsItem = ({ id, title, body }: JobListingsItemProps) => (
  <Listing
    type={`job`}
    id={id}
    className={`c-job-listings-item`}
    title={title}
  />
)

export default JobListingsItem
